import React from 'react'
import './Main.css'
import img from '../img/짭쥐 표지-18_cut.png'
import icon1 from '../img/map.png';
import icon2 from '../img/book.png';
import icon3 from '../img/clothes.png';
import icon4 from '../img/cooking.png';
import icon5 from '../img/news.png';

import M_book from './M_book'
import M_cook from './M_cook';
import M_fashion from './M_fashion';
import M_news from './M_news';
import M_traval from './M_traval';
import { Routes,Route, Link } from 'react-router-dom';

const Main = () => {

  // logo css
  const back = {
    display: 'flex',
    justifyContent: 'center',
    bottom:0,
    width:'100vw',
    height:'20vw',
    backgroundColor:'#3e448b'
  }


  return (
    <div>
      <div style={back}>
        <img src={img} style={{width:'90%', height:'90%'}}/>
      </div>
      <Routes>
        <Route to='/main/traval' element={<M_traval/>}/>
      </Routes>
      {/* 아이콘 페이지 */}
      <div className='iconCon'>
        <Link to='/main/traval' className='icon aa'>
          <img className='iconImg' src={icon1}/>
        </Link>
        <Link to='/main/book' className='icon aa'>
          <img className='iconImg' src={icon2}/>
        </Link>
        <Link to='/main/fashion' className='icon aa'>
          <img className='iconImg' src={icon3}/>
        </Link>
        <Link to='/main/traval' className='icon aa'>
          <img className='iconImg' src={icon4}/>
        </Link>
        <Link to='/main/traval' className='icon aa'>
          <img className='iconImg' src={icon5}/>
        </Link>
      </div>
      <div className='explain'>
        <div>
          <div>map</div>
        </div>
      </div>
    </div>
  )
}

export default Main
